import React, {useState, useEffect} from 'react'
import {useNavigate} from 'react-router-dom'

const Filtering = (props) => {

    

    
  return (
    <div className="form-check form-check-inline">
        <input className="form-check-input" type="checkbox" id={props.value} value={props.value} defaultChecked={false}  />
        <label className="form-check-label" htmlFor="inlineCheckbox1">{props.value}</label>
    </div>
  )
}

export default Filtering
